import React ,{useEffect}from 'react'
import {useParams} from "react-router-dom";
import axios from 'axios';

function Post() {
    let { id } = useParams();

    useEffect(()=>{
      axios.get(`http://localhost:3001/posts/byID/${id}`).then((response)=>{
        console.log(response);
    });
  });


  return (
    <div>
       UserID:{id}
    </div>
  )
}


export default Post;
